records.addlTxt:
Defendant Brianna G McMillan in court with attorney Katie B. Bricco.  Kevin M. Osborne appeared for the State of Wisconsin.
Plea Colloquy.
Defendant enters a guilty plea to Counts 1 and 2.  Court finds defendant guilty.  Count 3 is dismissed and read in.
Statement by victim.  

The Court Orders the Following:

COUNT 1
Imposed and Stayed Sentence of:

 20 Days Huber (Credit - 2 days) HUBER WITH STANDARD RELEASE CONDITIONS.

Term of Probation: 2 Years

Conditions of Probation:
- AODA Assessment and follow through with any treatment recommended;
- Mental Health Evaluation and follow through with any treatment recommended;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Complete Anger Management Program;
- Maintain valid driver's license;
- Operate a Motor Vehicle with a Valid Drivers License;
- Maintain/Obtain full time employment;
- No violent contact with victims.

Costs: $343.00 
DNA Surcharge:  $200.00


COUNT 2
Imposed and Stayed Sentence of:

20 Days  HUBER WITH STANDARD RELEASE CONDITIONS.  CONSECUTIVE TO COUNT 1

Term of Probation: 2 Years  CONCURRENT TO COUNT 1

Conditions of Probation:  Same as Count 1

Restitution:  $99.00 to be paid within the first 6 months of probation

Costs: $353.00 
DNA Surcharge:  $200.00

Costs and surcharges to be paid as a condition of probation at the rate of $50.00  per month commencing 4-1-15.  Failure to pay  the Court orders 6 days Jail as contempt for non-compliance with Court Order. 

Expunction is conditionally granted upon completion of sentence, payment of all costs/fees/restitution and no new criminal law violations.  Defendant must Petition the Court in writing upon successful completion of the sentence.
